import React from 'react'
import Navbar from "../components/navbar.jsx"
import styled from 'styled-components'
const Home = () => {
    const HeroBody = styled.body`
        display: grid;
        grid-template-columns:repeat(12, 1fr) ;
    `
    const HeroText = styled.h1`
        font-size: 96px;
        grid-column: 2/6;
    `
    return (
        <>
            <Navbar AuthToken />
            <HeroBody>

                <HeroText>
                    Swipe Your Way
                    To Shop
                </HeroText>
            </HeroBody>
        </>
    )
}

export default Home
